actionConfiguration.body:
()=>{
		GetGSheetContent_UpdateAlias.run(
			//success
			() => {
				let array_payload=[];		
				let APIdata = [];
				APIdata = GetGSheetContent_UpdateAlias.data.values;
				for (let i=1;i<APIdata.length;i++){
					array_payload.push({
						"id" : APIdata[i][0],
						"alias": APIdata[i][1],
						"productId": APIdata[i][2],
						"providerId": ((APIdata[i][3]==null||APIdata[i][3]=="")?null:APIdata[i][3]),
						"sourceId": ((APIdata[i][4]==null||APIdata[4][1]=="")?null:APIdata[i][4])
					})						
				}
				storeValue("Key_UpdateAlias_UserPayload", array_payload);
			},
			//fail
			() => {showAlert("Something went wrong - Data not inserted")}			
		)
	}

